window.bookSummaryJSON = "<p>What has a beginning but no end?</p> <p>Azure and his companions face their greatest challenge yet as they're put through Luuq's Fun House. Looking in a magic mirror, many are surprised by what they see. Separated and forced to endure personal trials of their own will be less harrowing than what happens when they're brought back together. And Azure discovers that no party ever meets the God of Death without paying the ultimate price.</p> <p>Will Azure live or die? And what's Jin's true identity? Everything comes to a head in this exciting conclusion of The Realm Between.</p>"; 
